import React from 'react';
import Link from 'next/link';

const Pokemon = ({ pokemon }) => {

    const {name, image, url} = pokemon;

    return (
        <li>
            <h3>
                { name }
            </h3>
            <Link href = {url}>
                <a><img src = {image} alt = "Pokemon Image" /></a>
            </Link>
            
        </li>
    );
}
 
export default Pokemon;
